['Contrast']=1,['Y']=20032,['SizeY']=500,['Color']=999999,['SizeX']=466.666670,['Groups']=0,['Alpha']=1,['Z']=65087,['Roll']=0,['Yaw']=5.276130,['Pitch']=0,['SizeZ']=500,['X']=63731,},[41]={['EffectType']=5085,['Id']=1695,['Contrast']=1,['Y']=20032,['SizeY']=500,['Color']=999999,['SizeX']=466.666670,['Groups']=0,['Alpha']=1,['Z']=65087,['Roll']=0,['Yaw']=5.276130,['Pitch']=0,['SizeZ']=500,['X']=63731,},[42]={['EffectType']=5085,['Id']=1696,['Contrast']=1,['Y']=20032,['SizeY']=500,['Color']=999999,['SizeX']=466.666670,['Groups']=0,['Alpha']=1,['Z']=65087,['Roll']=0,['Yaw']=5.276130,['Pitch']=0,['SizeZ']=500,['X']=63731,},[43]={['EffectType']=5085,['Id']=1697,['Contrast']=1,['Y']=20032,['SizeY']=500,['Color']=999999,['SizeX']=466.666670,['Groups']=0,['Alpha']=1,['Z']=65087,['Roll']=0,['Yaw']=5.276130,['Pitch']=0,['SizeZ']=500,['X']=63731,},[44]={['EffectType']=5085,['Id']=1698,['Contrast']=1,['Y']=20032,['SizeY']=500,['Color']=999999,['SizeX']=466.666670,['Groups']=0,['Alpha']=1,['Z']=65087,['Roll']=0,['Yaw']=5.276130,['Pitch']=0,['SizeZ']=500,['X']=63731,},[45]={['Groups']=0,['SizeY']=37,['Id']=1699,['Contrast']=1,['EffectType']=8502,['Pitch']=4.712564,['Color']=994500,['SizeX']=24.456456,['Alpha']=1,['Y']=20154,['Z']=64941,['Roll']=0,['Yaw']=1.642355,['MetaData']={['title']='Garden in Sovngarde',['message']='I remember the day I first learned of you,\\nThe rain was slowing, and the distance there was not one rainbow, but two.\\n\\nI remember the day we met for the very first time,\\nIt was easy to tell that you were mine.\\n\\nI will never forget all of your firsts,\\nFirst smile..\\nFirst word..\\nFirst steps..\\nFirst hug...\\nRemembering these still makes my heart overflow with love.\\n\\nYour favorite thing to drink was sweet tea,\\nI remember thinking, \"Woo! Lucky me!\"\\n\\nThere are so many moments of your life I will cherish.\\nI think of you every day, and wonder to myslef, \"If only...\"\\n\\nIf only...\\nI had gotten gas the night before.\\nYour father\\'s flight wasn\\'t delayed.\\nI had hugged you tighter.\\nI could teach you to dance, about girls, and helped you choose a college.\\n\\nI had the whole day planned, a surprise for your birthday, and your father was home from deployment.  But, then.. my greatest fear took that all away in a single moment.\\n\\nI remember the moment when my son and my husband were taken from me.    The world grew a little dimmer, and people always say that the passing of time will make it a little less hard.  Though I am sad, I know that one day we will meet again, and you have your father with you go guide you to where we will meet in Sovngarde.\\n\\nThis design is dedicated to Morningstar, as a thank you for reminding me of the special moments I shared in the five short years I was able to have with my son, and the eight years I had with my husband.\\n\\nThis is our little garden in Sovngarde, a place to reflect on the things we enjoyed the most as a family, as well as a place to show some appreciation for those in the community who have brought me many smiles and good memories.\\n\\nAlso a nod to Pomipom and an EU decorator for inspiration.\\n\\nEnjoy,\\nHootems\\n',},['SizeZ']=37,['X']=63771,},[46]={['EffectType']=5085,['Id']=1700,['Contrast']=1,['Y']=20032,['SizeY']=500,['Color']=999999,['SizeX']=466.666670,['Groups']=0,['Alpha']=1,['Z']=64911,['Roll']=0,['Yaw']=5.276130,['Pitch']=0,['SizeZ']=500,['X']=63624,},[47]={['EffectType']=5085,['Id']=1701,['Contrast']=1,['Y']=20032,['SizeY']=500,['Color']=999999,['SizeX']=466.666670,['Groups']=0,['Alpha']=1,['Z']=64911,['Roll']=0,['Yaw']=5.276130,['Pitch']=0,['SizeZ']=500,['X']=63624,},[48]={['EffectType']=5085,['Id']=1702,['Contrast']=1,['Y']=20032,['SizeY']=500,['Color']=999999,['SizeX']=466.666670,['Groups']=0,['Alpha']=1,['Z']=64911,['Roll']=0,['Yaw']=5.276130,['Pitch']=0,['SizeZ']=500,['X']=63624,},[49]={['EffectType']=5085,['Id']=1703,['Contrast']=1,['Y']=20032,['SizeY']=500,['Color']=999999,['SizeX']=466.666670,['Groups']=0,['Alp