R["fx__@jloker"]="{['TS']=1619390657,['Key']='fx__@jloker',['Houses']={[1]={['Version']='1716',['TS']=1619390657,['Effects']={[1]={['Groups']=1,['MetaData']={['message']='Nord cuisine reflects the harsh climate and rugged landscape that has shaped their warrior culture.\\n\\nWhere farming is difficult, wild game supplies a significant portion of the local diet.\\n\\nThese meats can be preserved through smoking, drying, pickling, or salting.\\n\\nA good deal of fish also features, such as salmon caught in the quick-flowing White River.\\n\\nAmong the most mouth-watering Nord foods, however, are those served at great feasts.\\n\\nLarge roasts of mammoth, horker, and assorted game meats are cooked over a spit in the center of the hall, while rustic desserts made with juniper or snowberries are cooked in cob ovens.\\n\\nThose same northern ingredients make their way into Nord mead, which has developed a reputation for its strength in other parts of Tamriel.\\n\\nIn this thorough collection you\\'re sure to find new favorite dishes that makes you fight faster and harder and better and stronger, like a true Nord warrior.',['title']='\"Classical Nord Cuisine\"',},['Color']=992406,['SizeX']=26.456456,['Id']=1006,['SizeY']=30,['X']=20096,['Pitch']=4.712564,['SizeZ']=30,['Roll']=0,['Contrast']=2.260000,['Alpha']=1,['Yaw']=2.956588,['EffectType']=8502,['Z']=28540,['Y']=20141,},[2]={['Groups']=0,['MetaData']={['message']=' Oh, the tears that you weep\\n For the poor tortured souls\\n Who fall at your feet\\n With their love begging bowls\\n All the clerks and the tailors\\n The sharks and the sailors\\n All good at their trades, but\\n They\\'ll always be failures\\n \\n Alms for the poor\\n For the wretched disciples\\n And the love that they swore\\n With their hearts on the Bible\\n Beseeching the honor\\n To sit at your table\\n And feast on your holiness\\n As long as they\\'re able\\n \\n Love needs its martyrs\\n Needs its sacrifices\\n They live for your beauty\\n And pay for their vices\\n Love will be the death of\\n My lonely soul brothers\\n But their spirits shall live on in\\n The hearts of all lovers\\n \\n You\\'re holding court\\n With your lips and your smile\\n Your body\\'s a halo\\n Their minds are on trial\\n Sure as Adam is Eve\\n Sure as Jonah turned whaler\\n They\\'re crooked love thieves\\n And you are their jailer\\n \\n Love needs its martyrs\\n Needs its sacrifices\\n They live for your beauty\\n And pay for their vices\\n Love will be the death of\\n My lonely soul brothers\\n But their spirits shall live on in\\n The hearts of all lovers\\n \\n Love will be the death of\\n My lonely soul brothers\\n But their spirits shall live on in\\n The hearts of all lovers',['title']='\"The Love Thieves\"',},['Color']=991693,['SizeX']=26.456456,['Id']=1007,['SizeY']=30,['X']=19329,['Pitch']=4.712564,['SizeZ']=30,['Roll']=0,['Contrast']=1,['Alpha']=1,['Yaw']=1.727876,['EffectType']=8503,['Z']=28320,['Y']=20661,},[3]={['Groups']=1,['MetaData']={['message']='[ Loctavian\\'s \"Chopped\" Housing Contest ]\\n\\n\"Our second housing contest in the Elder Scrolls Online will be a mixture of a standard housing contest and the gameshow \\'Chopped\\'! Everyone who enters will get a \\'basket\\' of housing items (this will be the same items for all contestants). You can use any other housing items you have, any home you own, and the theme choice is yours. You will be given a MAJOR item and five MINOR items, where the MAJOR item has to be used and you\\'re to use at least four of the five MINOR items.\"\\n\\nMAJOR:\\nMarkarth Fireplace, Stone\\n\\nMINOR:\\nElsweyr Sarcophagus, Ancient\\nVampiric Mirror, Standing\\nAlinor Potted Plant, Perpetual Bloom\\nWedding Curtain, Wide\\nKhajiit Bottle, Amber\\n \\n[ Description ]\\n\\nMy home is called \"The Love Thieves\", which is a homage to the Depeche Mode song of the same name. I originally started on this project for a friend\\'s housing competition for Valentine\\'s Day called \"First Date\", but as it was a massive undertaking I was never able to finish it in time for the contest. The Chopped contest has enabled me to finish my vision, and even go beyond it.\\n\\nThe home is heavily revolving around a pair having a romantic rendezvous; where they can cook together, eat together, relax together, etc. As \"The Love Thieves\" contains several references to Christianity, some Christian references are added to the home in a non-confessional way.\\n\\nMy home is almost entirely cobbled from scratch. I\\'ve used all 200 slots and also use 4 EHT effects in the form of books; a blue \"recipe book\" in the kitchen, an green book in the bookshelf containing information about the contest, a purple book with the lyrics of \"The Love Thieves\" song, and a red book at the bottom of the bookshelf with spoilers and trivia about the home.\\n\\n[ House Completed: 2021-04-25 ]',['title']='\"Contest Information\"',},['Color']=179900,['SizeX']=29.456456,['Id']=1009,['SizeY']=50,['X']=18850,['Pitch']=5.742133,['SizeZ']=50,['Roll']=0,['Contrast']=0.350000,['Alpha']=1,['Yaw']=4.085816,['EffectType']=8501,['Z']=28495,['Y']=20304,},[4]={['Groups']=0,['MetaData']={['message']='(In order of appearance from the entrance.)\\n\\nIn the hallway directly to the right as we enter we find the \"Alinor Potted Plant, Perpetual Bloom\". The giant pot is sunken down into the floor to give a less outdoorsy feel and give it a more designed feature feel.\\n\\nNext to the plant in the hallway we find the \"Vampiric Mirror, Standing\", enabling visitors to check their appearance as they enter and leave the home.\\n\\nAs we enter the home the kitchen counter\\'s side facing us is given a bit more elegant feel by using a corner of the \"Wedding Curtain, Wide\" as a form of draped covering.\\n\\nFour \"Khajiit Bottles, Amber\" make up the cobbled dining table\\'s legs. Flipped them upside down and tried to get them at a decent height in order to place the tabletop upon them.\\n\\nSeveral \"Elsweyr Sarcophaguses, Ancient\" are the foundations to make the ramps to the upper floor. I\\'ve utilized mainly the bottom sides, but also the cool engravings on the sides.\\n\\nThe \"Markarth Fireplace, Stone\" is the frame and foundation of the bed, making it look like a big luxurious (albeit hard) kingsize bed.',['title']='\"Chopped Competition Spoilers\"',},['Color']=487,['SizeX']=28.456456,['Id']=1010,['SizeY']=50,['X']=18926,['Pitch']=4.712564,['SizeZ']=50,['Roll']=0,['Contrast']=0.630000,['Alpha']=1,['Yaw']=4.447099,['EffectType']=8501,['Z']=28502,['Y']=20175,},[5]={['Groups']=0,['MetaData']={['message']='SERPENTS. Serpents are a bit of a theme throughout the home. From the \"Cobalt Sep Adder\"  in the hallway, to the \"Craglorn Chairs, Serpent\" in the dining room, to the \"Ayleid Constellation Stele, The Serpent\" decorating the ramp to the second floor, to the \"Murkmire Rug, Crawling Serpents Worn\" leading to the bedroom.\\n\\nSEASONS. In both the kitchen and the dining room the paintings are polar opposites based on the seasons. In the kitchen we have the \"Painting of Autumn, Bolted\" and opposite it the \"Painting of Spring, Sturdy\", while in the dining room the \"Painting of Winter, Bolted\" and across it \"Painting of Summer, Sturdy\". They\\'re also placed so that combining the paintings together around you in a circle it would recreate the cycle of the seasons in clockwise order.\\n\\nNORDS. As I only play Nord characters there\\'s also a few hints to the race or to places in Skyrim, such as Solitude and Markarth. The most prominent Nord or Skyrim hints being the \"Classical Nord Cousine\" EHT book, the two \"Markarth Doors, Double\", the \"Nord Banners, Knotwork\" framing the downstairs fireplace, the \"Nord Tapestry, Ship\" on the wall next to the ramps, the \"Nord Tapestry, Dragon\" decorating the upstairs fireplace, and of course the two ESO+ statues on the upstairs fireplace; \"Statuette: Son of Skyrim\" and \"Statuette: Child of the Sky\", and the \"Markarth Fireplace, Stone\" in the bedroom.\\n\\nCHRISTIANITY. References include; the \"Cobalt Sep Adder\" guarding his apple like the snake unraveling from the tree in the Garden of Eden, and the broken \"Solitude Bread, Partial Loaf\" and the wine on the table alluding to the Last Supper.',['title']='\"Home Trivia: Part 1\"',},['Color']=487,['SizeX']=28.456456,['Id']=1011,['SizeY']=50,['X']=18895,['Pitch']=5.672320,['SizeZ']=50,['Roll']=0,['Contrast']=0.630000,['Alpha']=1,['Yaw']=4.056145,['EffectType']=8501,['Z']=28503,['Y']=20081,},[6]={['Groups']=0,['MetaData']={['message']='JOKER. The \"Jester\\'s Coffer\" with the inside \"Gaming Die\" rolled to one represents the joker playing card and both the The Fool (0) and The Magician (1) major arcana tarot cards. The other visible sides of the die also allude to my IRL birthday.\\n\\nSOCCER. The white lily-looking \"Pale Garden Flowers\" and the golden \"Ra Gada Funerary Statues, Miniature Ibis\" birds are references to the football team I support IRL.',['title']='\"Home Trivia: Part 2\"',},['Color']=487,['SizeX']=28.456456,['Id']=1012,['SizeY']=50,['X']=18827,['Pitch']=0.785398,['SizeZ']=50,['Roll']=0,['Contrast']=0.630000,['Alpha']=1,['Yaw']=4.056145,['EffectType']=8501,['Z']=28452,['Y']=20104,},},['World']='eu',['HouseId']=16,},},}"
