 well.',},['SizeY']=34,['Pitch']=0.066323,['SizeZ']=34,['Alpha']=1,},[98]={['Yaw']=2.078687,['Groups']=1,['SizeX']=30.456456,['Y']=29082,['Z']=71421,['Roll']=0,['Color']=996159,['Contrast']=0.840000,['EffectType']=8501,['Id']=1104,['X']=71747,['MetaData']={['title']='Quartermaster\\'s Crafting Update',['message']='For basic crafting needs, all stations are located on the Quartermaster\\'s dock. There is an additional provisioning station at the Mess Hall.\\n\\nFor crafting specific gear sets, you can visit the TMV Attunable Crafting Outpost located way up high in some fucking mountains. Here is a list of the current sets available - we\\'re just getting started on this, so this list will grow:\\n\\nFULL SETS (all 4 stations):\\n\\nHunding\\'s Rage\\nLaw of Julianos\\nNew Moon Acolyte\\n\\nPARTIAL SETS:\\nShacklebreaker',},['SizeY']=34,['Pitch']=0.066323,['SizeZ']=34,['Alpha']=1,},[99]={['Yaw']=2.078687,['Groups']=1,['SizeX']=30.456456,['Y']=29082,['Z']=71342,['Roll']=0,['Color']=991288,['Contrast']=0.840000,['EffectType']=8501,['Id']=1105,['X']=71686,['MetaData']={['title']='Contributing to TMV!',['message']='As our numbers grow, we are expanding things rapidly! One of our key focuses right now is to build out the auxiliary guild base (The TMV Attuned Crafting Outpost). See the other note here on the board for what is there currently, but if you want to help us get their faster, read on!\\n\\nYou can contribute to our growth in a lot of ways. But right now, the main need is to acquire more attuned crafting stations. You can get them at various guild traders, or by earning master writ vouchers and buying them from the Master Writ merchant.\\n\\nWe need all 4 types! Blacksmithing, Clothing, Woodworking, and Jewelry. Don\\'t actually attune them to a given set, though - I need them blank so I can start filling in gaps and completing full sets of stations. :)\\n\\nIf you aren\\'t in a position to do that, don\\'t worry. There are other ways to help! We don\\'t have any 